import React from "react";

interface Components {
  header: object;
  content: object;
  footer: object;
}

class BaseComponent extends React.Component<Components> {
  render() {
    const { header, content, footer } = this.props;
    return (
      <div className="table w-full h-full table-fixed bg-gray-100">
        <div className="table-row border-b-2 bg-white">
          <div className="h-24">
            <div className="text-cente fixed top-0 w-full">{header()}</div>
          </div>
        </div>
        <div className="p-2 w-full table-row">
          <div className="max-w-screen-md ml-auto mr-auto h-full">
            {content()}
          </div>
          <div className="max-w-screen-md ml-auto mr-auto h-full">
            {footer()}
          </div>
        </div>
        <div className="bg-white fixed w-full bottom-0 border-2 border-gray-200 rounded-t-3xl">
          <div className="h-24">
            {footer()}
          </div>
        </div>
      </div>
    );
  }
}

export default BaseComponent;
